import React from 'react';
import './NavBar.css';
import SearchBar from './SearchBar.jsx';
import FoodData from '../FoodData.json';

const NavBar = () => {
  return (
    <div className="container">
      <nav className="nav">
        <div className="logo">Farmerize</div>
        <SearchBar />
        <ul className="nav-links">
          <li>
            <a>Logo</a>
          </li>
          <li>
            <a>Farmerize</a>
          </li>
          <li>
            <a>Search</a>
          </li>
          <li>
            <a>Wishlist</a>
          </li>
          <li>
            <a>Cart</a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default NavBar;
